import Head from 'next/head';

const Index = ()=>(
    <div>
    <Head>
    <link href="https://maxcdn.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css" rel="stylesheet" />
    <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.0/css/bootstrap.min.css"/>
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
    <script src="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.0/js/bootstrap.min.js"></script>
    <title>LiveIzy</title>
    </Head>
    <div className="container-fluid">
    <header>
        
    
            <nav className="navbar navbar-expand-sm navbar-dark">
            <a className="navbar-brand" href='#'><img src="/logo.png"style={{width:'60%',marginLeft:'10%',marginTop:'35px'}}/></a>
            <ul className="navbar-nav">
                <li className="nav-item">
                <a className="nav-link" href="#">About Us</a>
                </li>
                <li className="nav-item dropdown">
                <a className="nav-link dropdown-toggle" href="#" id="navbardrop" data-toggle="dropdown">
                    All Services
                </a>
                <div className="dropdown-menu">
                    <a className="dropdown-item" href="#">izyRent</a>
                    <a className="dropdown-item" href="#">izyProman</a>
                    <a className="dropdown-item" href="#">izyPay</a>
                    <a className="dropdown-item" href="#">izyfood</a>
                </div>
                </li>
                <li className="nav-item">
                <a className="nav-link" href="#">Rent</a>
                </li>
                 <li className="nav-item">
                <a className="nav-link" href="#">Team</a>
                </li>
            </ul>
            <button className="navbar-btn btn-outline-primary float-right">Login</button>
            <button className="navbar-btn btn-light ml-auto mr-5">SignUp</button>
            
            </nav>
        
    </header>

    <main>
        <div className='container container1'>
            <div className='row'>
                <div className=" col-md-7 col-12">
                    <h1>Rent.now.Pay latter.</h1>
                    <h1>List your property and guaranty your rent</h1>
                    <p>Whether you have one apartment or one thousand, <br/>Liveizy makes life easier</p>
                    <div className='row'>
                        <div className='col-md-7 col-12'>
                            <input type='text' className="form-control" placeholder="Enter your email address"/>
                            <button type='submit' className='btn btn-primary'>Get started it is free</button>
                        </div>
                    </div>
                    
                </div>
                <div className=" col-md-5 col-12">
                    <div className='img-cover'>
                    <img src='/home-smile.png' className='img-fluid'/>
                    <div className='img-text text-center'>Peace of mind </div>
                    </div>
                </div>
                
            </div>
        </div>
    </main>
    <footer>This is  my footer</footer>
    </div>
    <style jsx>{`
        .container-fluid{
            padding-right:0;
            padding-left:0;
            margin-right:auto;
            margin-left:auto;
        }
        .container1{
            padding-top:40px;
            padding-bottom:40px;
        }
        .img-fluid{
            border-top-left-radius:50px;
            height:330px;
        }
        .img-cover{
            background-color:#0b3469;
            border:20px solid #0b3469;
            height:450px;
            width:85%;
        }
        .img-text{
            width:100%;
            background-color:#c8222c;
            height:22%;
            padding-top:35px;
            padding-bottom:35px;
            
        }

        .navbar-nav{
            margin-left:130px;
            margin-top:35px;
            

        }
        .nav-item .nav-link{
            color:#fff;
            margin-right:35px;
        }

        .navbar-btn{
            margin-top:35px;
        }
        .navbar-btn.btn-outline-primary{
            margin-left:120px;
            
        }
        .dropdown .dropdown-menu a{
            color:#000;
            text-align:center;
            
        }


        

        
        
    `}
    </style>
    <style global jsx>{`
        body{
            margin:0;
            padding:0;
            background-color:#051138;
            color:#fff;
        }
        * {box-sizing: border-box;
            
        }
    `}
    
    </style>
    </div>
);
export default Index;
